import { BrowserRouter, Route, Link } from "react-router-dom";
import CCustomer from './CCustomer';
import RCustomer from './RCustomer';
import UCustomer from './UCustomer';
import DCustomer from './DCustomer';


const CustomerIndex =()=>{

    const currentDomain = '/Customer';
    const [linking, setlinking] = useState([    // [path, component]
        ['/Create', CCustomer],
        ['/Read', RCustomer],
        ['/Update', UCustomer],
        ['/Delete', DCustomer]

    ])

    const linkInfo = linking.map(
    (i)=>{
        return <Link to={currentDomain + i[0]}>
                    i[1]
                </Link>
    }
    )




    return(
        <div>
            <h1>This is Customer</h1>
            {linkInfo}
        </div>
    )
}

export default CustomerIndex;
